from xlrd import open_workbookfrom xlrd.sheet import ctype_textimport xlwtimport randomm = 415n = 78wb = open_workbook('WISERv4.xls')xl_sheet = wb.sheet_by_index(1)wb1 = xlwt.Workbook()wb1sheet = wb1.add_sheet('Symptoms')wb2 = xlwt.Workbook()wb2sheet = wb2.add_sheet('Symptoms')wb3 = xlwt.Workbook()wb3sheet = wb3.add_sheet('Symptoms')wb4 = xlwt.Workbook()wb4sheet = wb4.add_sheet('Symptoms')wb5 = xlwt.Workbook()wb5sheet = wb5.add_sheet('Symptoms')Scn = set()for i in range(2, m+2):    Scn.add(i)ScnTot = Scn#realScn = 7U = set()for i in range(2, n+2):    U.add(i)UTot = Ufor e in UTot:    wb1sheet.write(0,e,xl_sheet.cell(0,e).value)    wb2sheet.write(0,e,xl_sheet.cell(0,e).value)    wb3sheet.write(0,e,xl_sheet.cell(0,e).value)    wb4sheet.write(0,e,xl_sheet.cell(0,e).value)    wb5sheet.write(0,e,xl_sheet.cell(0,e).value)    wb1sheet.write(1,e,xl_sheet.cell(1,e).value)    wb2sheet.write(1,e,xl_sheet.cell(1,e).value)    wb3sheet.write(1,e,xl_sheet.cell(1,e).value)    wb4sheet.write(1,e,xl_sheet.cell(1,e).value)    wb5sheet.write(1,e,xl_sheet.cell(1,e).value)for s in ScnTot:    wb1sheet.write(s,0,xl_sheet.cell(s,0).value)    wb1sheet.write(s,1,xl_sheet.cell(s,1).value)    wb2sheet.write(s,0,xl_sheet.cell(s,0).value)    wb2sheet.write(s,1,xl_sheet.cell(s,1).value)    wb3sheet.write(s,0,xl_sheet.cell(s,0).value)    wb3sheet.write(s,1,xl_sheet.cell(s,1).value)    wb4sheet.write(s,0,xl_sheet.cell(s,0).value)    wb4sheet.write(s,1,xl_sheet.cell(s,1).value)    wb5sheet.write(s,0,xl_sheet.cell(s,0).value)    wb5sheet.write(s,1,xl_sheet.cell(s,1).value)        for e in UTot:        if(xl_sheet.cell(s,e).value == ''):            wb1sheet.write(s,e,0)            wb2sheet.write(s,e,0)            wb3sheet.write(s,e,0)            wb4sheet.write(s,e,0)            wb5sheet.write(s,e,0)        elif(xl_sheet.cell(s,e).value == 'X'):            wb1sheet.write(s,e,1)            wb2sheet.write(s,e,1)            wb3sheet.write(s,e,1)            wb4sheet.write(s,e,1)            wb5sheet.write(s,e,1)        else:            wb1sheet.write(s,e,random.getrandbits(1))            wb2sheet.write(s,e,random.getrandbits(1))            wb3sheet.write(s,e,random.getrandbits(1))            wb4sheet.write(s,e,random.getrandbits(1))            wb5sheet.write(s,e,random.getrandbits(1))wb1.save('data1.xls')wb2.save('data2.xls')wb3.save('data3.xls')wb4.save('data4.xls')wb5.save('data5.xls')